/* ==========================================================================
 Scripts de cálculo de frete
 ========================================================================== */
function ProductFreightsView() {

    this.getFreights = function (url, stockId, zipCode) {
        $.ajax({
            url: url,
            data: { stockIds: stockId, zipcode: zipCode },
            cache: false,
            error: function (xhr, error, errorThrown) {
                showComputeFreightButton();
            },
            success: showFreights
        });
    };

    function showFreights(json) {

        showComputeFreightButton();
        var $freightOptionsList = $(".deliver-today .options-freight-list");
        $freightOptionsList.empty();

        if (json == undefined) {
            $freightOptionsList.append('<tr class="headTitle"> <td class="freightType" colspan="3">Frete Temporariamente Indisponível</td></tr>');
            $('.tooltip-shipping').text('Frete Temporariamente Indisponível');
            return false;
        }

        if (json.message) {

            $('#freightListItem').empty().append(json.message);

        } else {

            var betterDeliveryTime = json.betterDeliveryTime;
            var resultSearchFreights = json.freights;
            var bestStockId = $('#bestStockId').val();
            var freight;

            if (bestStockId) {

                //somente na ficha do produto com vendedor principal

                $(resultSearchFreights).each( function() {
                    if (this.stockId == bestStockId) {
                        freight = this;
                        return false;
                    }
                });

                if (freight.zipcode) {
                    $("#zipcodeComputeFreight").val(freight.zipcode);
                }

                $freightOptionsList.append('<tr class="headTitle"> <td class="freightType">Entrega</td> <td class="options-freight-value">Prazo</td> <td class="frete">Frete</td> </tr>');

                var showAlertFreight = false;

                $(freight.allFreights).each(function () {

                    $freightOptionsList.append(freightItem(this));

                    var value = Number(this.amount.replace(",", ".").replace(/[^0-9\.]+/g,""));
                    if (value >= 100) {
                        showAlertFreight = true;
                    }

                });

                if (showAlertFreight) {
                    $('#freight-alert').removeClass('hide');
                } else {
                    $('#freight-alert').addClass('hide');
                }

                if (freight.turboFreight) {
                    $(".turbo").show();
                    $(".shipping-highlight-info").hide();

                } else {
                    $(".turbo").hide();
                    $(".shipping-highlight-info").show();
                }

            } else {

                //somente na pagina com lista de vendedores

                $(resultSearchFreights).each( function() {
                    showFreightToPartner($(this), betterDeliveryTime);
                });

            }

            $("#freightListItem").empty();
        }
    }

    function  showFreightToPartner($freightOption, betterDeliveryTime) {

        // FRETE
        var $economicFreight = $freightOption.attr('economicFreight');
        var $fastFreight = $freightOption.attr('fastFreight');

        //Lista de Fretes de um Vendedor (antigo tooltip "+")
        var $allFreights = $("#shipping-info-" + $freightOption.attr('stockId'));
        $allFreights.empty();

        var $freightItem;
        var $freightValue;

        var hasFreeShipping = false;

        var showAlertFreight = false;

        $($freightOption.attr('allFreights')).each( function() {

            $freightValue = $("<td>");

            if (!hasFreeShipping) {
                hasFreeShipping = (this.amount == 'R$ 0,00');
            }

            $freightValue.text(this.amount != 'R$ 0,00' ? this.amount : 'Grátis');

            var deliveryTimeText = "";

            if (this.deliveryTime == 1) {
                deliveryTimeText = this.deliveryTime + " dia útil";

            } else if (this.deliveryTime > 1) {
                deliveryTimeText = this.deliveryTime + " dias úteis";

            }

            $freightItem = $('<tr>');
            $freightItem.html('<td>' + this.name.length > 16 ? this.name.substr(0, 15) + '...</td>' : '<td>' + this.name + '</td>');

            $freightTime = $("<td>");

            if (this.fastDelivery || this.name == 'Retirada na Loja') {
                $freightItem.append('<td>-</td>');
            } else {
                $freightTime.text(deliveryTimeText);
                $freightItem.append($freightTime);
            }

            $freightItem.append($freightValue);
            $allFreights.append($freightItem);


            var value = Number(this.amount.replace(",", ".").replace(/[^0-9\.]+/g,""));
            if (value >= 100) {
                showAlertFreight = true;
            }


        });

        if (showAlertFreight) {
            $("#freight-alert-" + $freightOption.attr('stockId')).removeClass("hide");
        } else {
            $("#freight-alert-" + $freightOption.attr('stockId')).addClass("hide");
        }

        if (!hasFreeShipping) {
            $("#price-" + $freightOption.attr('stockId') + " .value-shipping").hide();
        }

        $('.price-and-shipping').show();

    }


    function freightItem(freight) {

        var item = $("<tr class='options-freight-item'>");

        var name = $("<td>");
        name.addClass('freightType').text(freight.name.length > 20 ? freight.name.substr(0, 20) + "..." : freight.name);
        item.append(name);

        if (freight.deliveryTime > 0) {
            var time

            if (freight.deliveryTime == 1) {
                time = freight.deliveryTime + " dia ";

            } else {
                time = freight.deliveryTime + " dias ";
            }
        }



        var timeSpan = $("<td>");
        timeSpan.addClass("options-freight-value").text(time);
        item.append(timeSpan);

        var priceText = freight.amount != 'R$ 0,00' ? freight.amount : 'Grátis';

        var price = $("<td>");
        price.addClass('frete').text(priceText);
        item.append(price);

        return item;
    }
}
ProductFreightsView.bind = function () {

    var stockIdList = $('#freightStockIdList').val();
    if (stockIdList == undefined) {
        return;
    }

    var url = $('#freightStockIdList').data('url');

    var productFreightsView = new ProductFreightsView();

    if ($("#zipcodeComputeFreight").val() || $("#zipcodeComputeFreight").data('logged')) {
        productFreightsView.getFreights(url, stockIdList, $('#zipcodeComputeFreight').val());
    }

    $('#btnComputeFreight').click(function (event) {

        event.preventDefault();

        var fieldset = $(this).parent();

        $(this).addClass('disabled');

        if ($("#container-load").length > 0) {
            $("#container-load").show();
        }
        else {
            $(fieldset).append("<div id='container-load' class='container-load'></div>");
        }

        var zipcode = $('#zipcodeComputeFreight').val();

        if (zipcode.length < 9) {

            $(".freight-cost .options-freight-list").empty();

            $('#freightListItem').empty().append("CEP inválido").show();

            $("#container-load").hide();

            showComputeFreightButton();

        } else {
            productFreightsView.getFreights(url, stockIdList, zipcode);
            $('.options-freight-list').removeClass('hide');

        }
        return false;
    });

    $(".options-freight-available").hide();
}
function showComputeFreightButton() {
    if ($("#container-load").length > 0) {
        $("#container-load").hide();
    }
    $("#btnComputeFreight").removeClass('disabled');
}
