fetchStocksPrices = function () {
    var prices = $.map($('.ajaxprice'), function (element) {
        var self = $(element);

        return $.ajax({
            url: '/price',
            data: {
                skuStockId: self.data('stockid')
            },
            dataType: 'json',
            success: function (data) {
                self.text(data.price);
            }
        });
    });

    var showMinAndMaxPrices = function () {
        var prices =
            $.map($('.ajaxprice'), function (element) {
                return parseInt(element.innerText.replace(/[R\W]/g, ''));
            }).sort(function (a, b) {
                return a - b;
            });

        var cheapest = prices.shift() / 100;
        var mostExpensive = prices.pop() / 100;

        $('.cheapest').text(cheapest.toReais());
        $('.mostExpensive').text(mostExpensive.toReais());
    };

    $.when.apply(null, prices).done(showMinAndMaxPrices);
};

function fetchPrices() {
    var prices = $.map($('[data-template]'), function (element) {
        var self = $(element);
        var skuLink = self.data('sku-link');
        var templateName = self.data('template');

        return $.ajax({
            url: '/sku/price',
            data: {
                skuId: self.data('sku-id'),
                zipcode: $('#zipcode-form').val() || self.data('zipcode'),
                seller: self.data('seller'),
            },
            dataType: 'json',
            success: function (data) {

                if (data.byContact || data.byRequest) {
                    $('.sku-main-actions-wrapper').show('fast');

                } else {
                    var templateName = self.data('template');

                    var bestPrice = data.nearest || data.cheapest;

                    if (bestPrice.packingTime && bestPrice.stockLeadTime) {
                        bestPrice.daysToSend = bestPrice.packingTime + bestPrice.stockLeadTime;
                    }

                    data.bestPrice = bestPrice;

                    var html = window.cdpTemplates.apply(templateName, {sku: data});

                    self
                        .html(html)
                        .show('fast');

                    changeSkuQuantity();
                }
            }
        });
    });

    var adjustItemsHeight = function () {
        var items = $("#showcase .grid .item:not('.brand-item') .item-container")
        var sizes = $.map(items, function(el) {
            return $(el).height();
        });
        items.height(Math.max.apply(null, sizes));
    };

    $.when
        .apply(null, prices)
        .done(adjustItemsHeight);
}

