/* ==========================================================================
 Alterar quantidade de produtos na compra de produtos
 ========================================================================== */
function changeSkuQuantity(){
	$(".quantity-button").on("click", function() {

		var $button = $(this);
		var oldValue = $button.parent().find(".quantity-number").val();
		var maxValue = $button.parent().find(".quantity-number").data('max-value');

		if ($button.hasClass("add")) {
			var newVal = parseFloat(oldValue) + 1;

			if (maxValue && newVal > maxValue) {
				newVal = maxValue;
            }
		} else {

			if (oldValue > 1) {
				var newVal = parseFloat(oldValue) - 1;
			} else {
				newVal = 1;
			}
		}

        $button.parent().find(".quantity-number").val(newVal);

	});

	$('.quantity-number').blur(function() {

		var minValue = 1;
		var $input = $(this);
		var inputValue = $input.val();
		var maxValue = $input.data('max-value');

		if (maxValue && inputValue > maxValue) {
			$input.val(maxValue);
		}

		if (inputValue < minValue) {
			$input.val(minValue);
		}
	});
}

